import React from 'react';
import './mainpage.css';
import SignUp from './component/signup';
import SignUpContainer from './component/SignupContainer';

class MainPage extends React.Component{
	render(){
  		return (
    		<div className="main-page">
				<SignUpContainer />
				<SignUp/>
			</div>
  		);
	}
}

export default MainPage;
